                dx1 = src[1].x - src[2].x;
                dx2 = src[3].x - src[2].x;
                dy1 = src[1].y - src[2].y;
                dy2 = src[3].y - src[2].y;
                den = dx1 * dy2 - dx2 * dy1;
                
                sq[6] = (px * dy2 - dx2 * py) / den;
                sq[7] = (dx1 * py - px * dy1) / den;
                sq[8] = 1;
                sq[0] = src[1].x - src[0].x + sq[6] * src[1].x;
                sq[1] = src[3].x - src[0].x + sq[7] * src[3].x;
                sq[2] = src[0].x;
                sq[3] = src[1].y - src[0].y + sq[6] * src[1].y;
                sq[4] = src[3].y - src[0].y + sq[7] * src[3].y;
